Solution:
Since Laura spends  5  minutes in transition, a total of  110-5=105  minutes are spent in motion. This is equivalent to    frac{105}{60}=1.75  hours. We know that    text{distance}=  text{rate}  cdot  text{time} , so    text{time}=  frac{  text{distance}}{  text{rate}} . Thus the time Laura spends biking is    frac{20  text{ miles}}{2x+1  text{ mph}}=  frac{20}{2x+1}  text{ hours} , and the time she spends running is    frac{5  text{ miles}}{x  text{ mph}}=  frac{5}{x}  text{ hours} . Thus the total time Laura is in motion is     frac{20}{2x+1}  text{ hours}+  frac{5}{x}  text{ hours}=1.75  text{ hours}.  We can solve this equation by multiplying through by a common denominator:   begin{align*}
(x)(2x+1)  left(  frac{20}{2x+1}+  frac{5}{x}  right)&=(1.75)(x)(2x+1)    
20(x)+5(2x+1)&=  frac{7}{4}(2x^2+x)    
20x+10x+5&=  frac{14x^2+7x}{4}    
4(30x+5)&=14x^2+7x    
120x+20&=14x^2+7x    
0&=14x^2-113x-20.
  end{align*}We can solve this using the quadratic formula, by writing    begin{align*}
x&=  frac{-b  pm  sqrt{b^2-4ac}}{2a}    
&=  frac{-(-113)  pm  sqrt{(-113)^2-4(14)(-20)}}{2(14)}    
&=  frac{113  pm  sqrt{13889}}{28}.
  end{align*}The two solutions are approximately  -0.1733  and  8.2447 . Since Laura isn't running at a negative speed, she runs    boxed{  approx 8.24   text{ mph}} .

Problem:
Wanda is trying to locate the Fermat point  P  of    triangle ABC , where  A  is at the origin,  B  is at  (8,-1) , and  C  is at  (5,4)  (the Fermat point is the point such that the sum of its distances from the vertices of a triangle is minimized). She guesses that the point is at  P = (4,2) , and computes the sum of the distances from  P  to the vertices of    triangle ABC . If she obtains  m + n  sqrt{5} , where  m  and  n  are integers, what is  m + n ?

[asy]
string sp(pair P1, string P2){return " " + P2 + "  ,(" + string(P1.x) + "," + string(P1.y) + ") ";}
size(150); defaultpen(fontsize(10)); draw((-3,0)--(10,0),Arrows(4)); draw((0,-3)--(0,8),Arrows(4)); pair A=(0,0),B=(8,-1),C=(5,4),P=(4,2); draw(A--B--C--cycle, linewidth(0.7)); draw(A--P, dashed); draw(B--P, dashed); draw(C--P, dashed); label(sp(A,"A"),A,NW); label(sp(B,"B"),B,S); label(sp(C,"C"),C,N); label(sp(P,"P"),P,(-0.5,-2.8)); dot(A); dot(B); dot(C); dot(P);
[/asy]

Solution:
By the distance formula,    begin{align*}
AP &=   sqrt{(4-0)^2 + (2-0)^2} =   sqrt{16 + 4} = 2  sqrt{5}     
BP &=   sqrt{(4-8)^2 + (2-(-1))^2} =   sqrt{16 + 9} = 5     
CP &=   sqrt{(4-5)^2 + (2-4)^2} =   sqrt{1+4} =   sqrt{5}
  end{align*}Hence,  AP + BP + CP = 5 + 3  sqrt{5} , and  m+n =   boxed{8} .

