draw((-4,2)--(4,2),red);

real f(real x) { return -.5*x^2-1.5*x+2;}
draw(graph(f,-4,-2));
draw((-2,3)--(2,1));
real f(real x) { return .5*x^2-1.5x+2;}
draw(graph(f,2,4));

