For how many positive integral values of  a  is it true that  x = 2  is the only positive integer solution of the system of inequalities   
  begin{cases}
2x>3x-3    
3x-a>-6
  end{cases}

Solution:
We apply the order of operations.  To see that this means to sum the denominator first, note that we can write the expression as   [1 + 2/  left(3 +   frac{4}{5}  right).  ] So, we have   begin{align*}
1 +   frac{2}{3+  frac{4}{5}} &= 1 +   frac{2}{  frac{15}{5} +   frac{4}{5}}    
&= 1 +   frac{2}{  frac{19}{5}}     
&= 1 + 2  cdot  frac{5}{19} =1 +   frac{10}{19}=  frac{19}{19} +   frac{10}{19} =   boxed{  frac{29}{19}}.
  end{align*}

This 4-term geometric series has first term  a_0 =   frac13  and ratio  r=  frac13 , so it has value    begin{align*}
  dfrac{  dfrac13  left(1-  left(  dfrac13  right)^{4}  right)}{1-  frac13} &=   dfrac{  dfrac13(1-  left(  dfrac13  right)^{4})}{  dfrac23}    
&=  dfrac12  left(1-  left(  dfrac13  right)^{4}  right)    
&=  dfrac12  left(  dfrac{80}{81}  right)    
&=  boxed{  dfrac{40}{81}}.
  end{align*}

We use the distance formula:   begin{align*}
  sqrt{(2 - (-6))^2 + (y - 5)^2} &=   sqrt{8^2 + (y - 5)^2}     
& =   sqrt{y^2 - 10y + 89}     
& = 10.
  end{align*}Squaring both sides and rearranging terms, we find that   begin{align*}
y^2 - 10y + 89 &= 100     
y^2 - 10y - 11 &= 0    
(y - 11)(y + 1) &= 0
  end{align*}Thus,  y = 11  or  y = -1 . We are given that  y > 0 , so  y =   boxed{11} .

When using the distributive property for the first time, we add the product of  x+3  and  x  to the product of  x+3  and  -8 :

  begin{align*}
(x+3)(x-8) &= (x+5)   cdot x + (x+5)   cdot (-8)    
&= x(x+3) - 8(x+3)
  end{align*}We use the distributive property again and combine like terms:

  begin{align*}
x(x+3) - 8(x+3) &= x^2 + 3x - 8x - 24    
&=   boxed{x^2 - 5x - 24}
  end{align*}

We begin by writing    frac{1}{4}  and  16  as powers of  2 .   begin{align*}
(2^{-2})^{2x+8} & = (2^4)^{2x+5}     
2^{-4x-16} & = 2^{8x + 20}     
-4x - 16 & = 8x + 20     
x & =   boxed{-3}
  end{align*}

There are two segments of Brenda's trip: from  (-4,5)  to  (0,0) , and from  (0,0)  to  (5,-4) . Using the distance formula, the total distance is    begin{align*}
  sqrt{(-4-0)^2+(5-0)^2}&+  sqrt{(5-0)^2+(-4-0)^2}    
&=  sqrt{16+25}+  sqrt{25+16}    
&=  boxed{2  sqrt{41}}.
