{

return x*(15-x);
}
xaxis(Arrows(4));
yaxis(ymax=f(7.5),Arrows(4));
draw(graph(f,-3,18),Arrows(4));
label("Area",(0,f(7.5)),N);
label(" l ",(18,0),S);[/asy]

We can find  x  by adding twice the first equation to five times the second. From   begin{align*}
2(3x-5y)+5(7x+2y)&=6x+35x    &=41x,
  end{align*}and   begin{align*}
2(3x-5y)+5(7x+2y)&=2(-11)+5(-12)    &=-22-60    &=-82,
  end{align*}we find that  41x = -82 , or  x=-2. 

Substituting into the second equation, we can find  y:    begin{align*}
7x+2y&=-12        implies y&=  frac{1}{2}(-12-7(-2))    &=  frac{1}{2}(-12+14)    &=  frac{1}{2}(2)    &=1.
  end{align*}Thus our answer is    boxed{(-2,1)}.

Since  y  and    sqrt{x}  are inversely proportional, this means that  y  sqrt{x}=k  for some constant  k .  Substituting the given values, when  x=2  and  y=4 , we find that  4  sqrt{2}=k .  Therefore, when  y=1 , we can solve for  x :   begin{align*}
1  cdot  sqrt{x}&=4  sqrt{2}    
  Rightarrow  qquad (  sqrt{x})^2&=(4  sqrt{2})^2    
  Rightarrow  qquad x&=16  cdot2=  boxed{32}
  end{align*}

Multiplying the numerator and denominator by the conjugate of the denominator, we have   begin{align*}
  frac{2+2i}{-3+4i}   cdot   frac{-3-4i}{-3-4i} &=   frac{2(-3) + 2(-4i) - 3(2i) + 2i(-4i)}{-3(-3) -3(4i) + 3(4i) -4i(4i)}     
&=   frac{2-14i}{25}     
&=   boxed{  frac{2}{25} -   frac{14}{25}i}.
  end{align*}

If  a  is inversely proportional to  b , then the product  ab  is a constant.  For  a_1  and  a_2  this implies:   a_1  cdot b_1=a_2  cdot b_2  We can divide both sides of this equation by  b_1  cdot a_2  to find:   begin{align*}
  frac{a_1  cdot b_1}{b_1  cdot a_2}&=  frac{a_2  cdot b_2}{b_1  cdot a_2}    
  Rightarrow  qquad   frac{2}{3}=  frac{a_1}{a_2}&=  frac{b_2}{b_1}    
  Rightarrow  qquad   boxed{  frac{3}{2}}&=  frac{b_1}{b_2}
  end{align*}

Seeing pairwise products, we consider    [
(a+b+c+d)^2=a^2+b^2+c^2+d^2+2(ab+ac+ad+bc+bd+cd),
  ]so   [
ab+bc+cd+da=  frac{(a+b+c+d)^2-a^2-b^2-c^2-d^2}{2}-(ac+bd).
  ]Since the fraction on the right-hand side does not depend on how the values of  a ,  b ,  c , and  d  are assigned, we maximize  ab+bc+cd+da  by minimizing  ac+bd .  Checking the three distinct values for  ac+bd , we find that  1  cdot4+2  cdot3=10  is its minimum value.  Therefore, the largest possible value of  ab+bc+cd+da  is     frac{(1+2+3+4)^2-1^2-2^2-3^2-4^2}{2}-10=  boxed{25}.

Problem:
Find  2^x  if

  begin{align*}
2^x+3^y&=5,    
2^{x+2}+3^{y+1} &=18.
  end{align*}

Solution:
Seeing pairwise products, we consider    [
(f+g+h+j)^2=f^2+g^2+h^2+j^2+2(fg+fh+fj+gh+gj+hj),
  ] so   [
fg+gh+hj+fj=  frac{(f+g+h+j)^2-f^2-g^2-h^2-j^2}{2}-(fh+gj).
  ] Since the fraction on the right-hand side does not depend on how the values of  f ,  g ,  h , and  j  are assigned, we maximize  fg+gh+hj+fj  by minimizing  fh+gj .  Checking the three distinct values for  fh+gj , we find that  5  cdot8+6  cdot7=82  is its minimum value.  Therefore, the largest possible value of  fg+gh+hj+fj  is    frac{(5+6+7+8)^2-5^2-6^2-7^2-8^2}{2}-82=  boxed{169} .

An  x -intercept is a point on the graph that lies on the  x -axis, so  y = 0 .  When  y = 0 ,  x = 3 , so  a = 3 .

A  y -intercept is a point on the graph that lies on the  y -axis, so  x = 0 .  Hence, the  y -intercepts correspond to the real roots of the quadratic equation  2y^2 - 6y + 3 = 0 .  By Vieta's formulas, the sum of the roots of this quadratic is  6/2 = 3 , so  b + c = 3 .

Therefore,  a + b + c = 3 + 3 =   boxed{6} .

[asy]
