Solution:
The distance between the midpoint of    overline{AB}  and an endpoint of    overline{AB}  is equal to half of the length of    overline{AB} . By the distance formula,

  begin{align*}
AB &=   sqrt{((t-4)-(-2))^2 + ((-1)-(t+3))^2}    
&=   sqrt{(t-2)^2+(t+4)^2}     
&=   sqrt{2t^2 + 4t + 20}
  end{align*}Also, we know that  (AB/2)^2 = t^2/2   Longrightarrow AB = 2  sqrt{t^2/2} =   sqrt{2t^2} . Setting these two expressions equal and squaring, we obtain   AB^2 = 2t^2 = 2t^2 + 4t + 20   Longrightarrow 4t + 20 = 0.  Thus,  t =   boxed{-5} .

Let the two numbers be  m=AB  and  n=CD  (where  A,B,C  and  D  are digits). The average of  m  and  n  is    frac{m+n}{2}  and the number formed by writing  m  before the decimal point and  n  after the decimal point is:   AB.CD = AB + 0.CD = AB+  frac{CD}{100} = m+  frac{n}{100}.   Setting these equal gives:   begin{align*}
  frac{m+n}{2} &= m+  frac{n}{100}    
50m+50n &= 100m+n    
49n &= 50m
  end{align*} From this it follows that  n  a multiple of 50. As  n  is a 2-digit positive integer this means that  n=50 . So now  50m = 49n = 49  cdot 50 , so  m=49 . Thus the integers are  49  and  50 , so the smaller integer is    boxed{49} .

Instead of expanding the entire product, we can look only at terms that will multiply to give  x^3 .  We know that:   x^3=x^3  cdot 1=x^2  cdot x=x  cdot x^2=1  cdot x^3  Knowing this, the  x^3  term in the expansion will be the sum of these four terms:   (-3x^3)(7)+(5x^2)(4x)+(-6x)(-3x^2)+(1)(2x^3)  We simplify to find:   begin{align*}
&(-3x^3)(7)+(5x^2)(4x)+(-6x)(-3x^2)+(1)(2x^3)    
&  qquad=-21x^3+20x^3+18x^3+2x^3    
&  qquad=  boxed{19}x^3.
  end{align*}

