[asy]
draw((0,0)--(4,0)--(2,2sqrt(3))--(0,0)--cycle,linewidth(1));
draw((2,0)--(3,sqrt(3))--(1,sqrt(3))--(2,0)--cycle,linewidth(1));

dot((0,0));
dot((2,0));
dot((4,0));
dot((1,sqrt(3)));
dot((3,sqrt(3)));
dot((2,2sqrt(3)));

label("Row 2",(-1,1));
label("Row 1",(0,2.5));

draw((3.5,2sqrt(3))--(2.2,2sqrt(3)),Arrow);
draw((4,2.5)--(2.8,2.5),Arrow);

label("connector",(5,2sqrt(3)));
label("unit rod",(5.5,2.5));
[/asy]

Solution:
The two lines have equations   [
y -15=3(x-10)  quad  text{and}  quad y -15=5(x-10).
  ]The  x -intercepts, obtained by setting  y=0  in the respective equations, are 5 and 7.  The distance between the  points  (5,0)  and  (7,0)  is    boxed{2} .

To solve for  x , we wish to eliminate  y . Multiply the first equation by  2  and add it to the second:   begin{align*}
(4x-2y) + (x+2y) &= 10+5    
5x &= 15    
x &=   boxed{3}
  end{align*}

Using the distributive property, we can expand this to get   begin{align*}
(x^{22}&-3x^{5} + x^{-2} - 7)  cdot(5x^4)    
&=(x^{22})(5x^4)+(-3x^5)(5x^4)+(x^{-2})(5x^4)-7(5x^4)    
&=5x^{26}-15x^9+5x^2-35x^4    
&=  boxed{5x^{26}-15x^9-35x^4+5x^2}.
  end{align*}

