The value of  p(1.5)  is an integer. What is it?

Solution:
Represent the three integers as  n-2 ,  n , and  n+2 , where  n  is the middle integer.  The problem states that    [
n(n-2)(n+2)=7(n+(n+2)+(n-2)),
  ] which simplifies to  (n-2)(n+2)=21 .  Since  7  cdot3  and  21  cdot1  are the only representations of 21 as a product of two positive integers, we see that  n-2=3  and  n+2=7  which implies  n=  boxed{5} .

Since the problem asks for  a+b , we look for a way to isolate  a+b  from the given equations.


Notice that  a + 6a = 7a  and  4b + 3b = 7b . This gives us the key to isolating  a + b . We simply add the two equations together:    begin{align*}
7a + 7b &= 84     
7(a + b) &= 84     
a + b &=   frac{84}{7}     
a + b &=   boxed{12}
  end{align*}

On the second, third, fourth, and fifth trips, you eat    frac1{2^2} ,    frac1{2^3} ,    frac1{2^4} , and    frac1{2^5}  of the pizza, respectively. The total portion of the pizza eaten is the geometric series   begin{align*}
  frac12+  frac1{2^2}+  frac1{2^3}+  frac1{2^4}+  frac1{2^5} &=   frac{  frac12  left(1-  left(  frac12  right)^5  right)}{1-  frac12}    
&=1-  left(  frac12  right)^5    
&=1-  frac1{32}    
&=  boxed{  frac{31}{32}}.
  end{align*}

The terms of the arithmetic progression are 9,  9+d , and  9+2d  for some real number  d . The terms of the geometric progression are 9,  11+d , and  29+2d . Therefore   [
(11+d)^{2} = 9(29+2d)   quad  text{so}  quad d^{2}+4d-140 = 0.
  ]Thus  d=10  or  d=-14 . The corresponding geometric progressions are  9, 21, 49  and  9, -3, 1,  so the smallest possible value for the third term of the geometric progression is    boxed{1} .

Problem:
Find the value of  a  so that the lines with the given equations are perpendicular.   begin{align*}
y &= 2x+13     
6y+ax &= 6.
  end{align*}

Solution:
Factoring our original equation:   [3x^2+10x-25=(3x-5)(x+5)=0  ]Therefore, the two solutions are  3x-5=0  and  x+5=0 .   begin{align*}
3x-5&=0    
3x&=5    
x&=  frac{5}{3}
  end{align*}
  begin{align*}
x+5&=0    
x&=-5
  end{align*}Therefore, either  d  or  e  could equal either    frac{5}{3}  or  -5 . However,  (d-e)^2=(e-d)^2  as shown below.   begin{align*}
(d-e)^2&=  {(-1)(e-d)  }^2    
&=(-1)^2(e-d)^2    
&=(e-d)^2
  end{align*}Setting    frac{5}{3}=d  and  -5=e :   begin{align*}
(d-e)^2&=  left(  frac{5}{3}-(-5)  right)^2    
&=  left(  frac{5}{3}+5  right)^2    
&=  left(  frac{20}{3}  right)^2    
&=  boxed{  frac{400}{9}}
  end{align*}

This is a finite geometric series with first term    frac{1}{3} , common ratio    frac{1}{3}  and  6  terms. Therefore the sum is:     frac{  frac{1}{3}  left(1-  frac{1}{3^{6}}  right)}{1-  frac{1}{3}}
=  frac{  frac{3^{6}-1}{3^{7}}}{  frac{2}{3}}
=   frac{3^{6}-1}{2  cdot3^{6}}=  frac{729-1}{2  cdot 729} =   boxed{  frac{364}{729}}.

