&  qquad = Ax^3 + Bx^2 + Cx + D .  end{align*}Computing the products on the left side gives   [3x^3-x^2+5x+6x^2-2x+10 = Ax^3 + Bx^2 + Cx + D .  ]Simplifying the left side gives   [3x^3+5x^2+3x+10 = Ax^3 + Bx^2 + Cx + D,  ]so  A=3 ,  B=5 ,  C=3 , and  D=10  and   A+B+C+D=3+5+3+10=  boxed{21}.

If Terrell lifts two 20-pound weights 12 times, he lifts a total of  2  cdot 12  cdot20=480  pounds of weight.  If he lifts two 15-pound weights instead for  n  times, he will lift a total of  2  cdot15  cdot n=30n  pounds of weight.  Equating this to 480 pounds, we can solve for  n :   begin{align*}
30n&=480    
  Rightarrow  qquad n&=480/30=  boxed{16}
  end{align*}

We simplify, bearing in mind that  i^2 = -1 . We get    begin{align*}
(4-5i)(-5+5i) &= 4(-5) + 4(5i) -5i(-5) -5i(5i)      &= -20 +20i +25i +25      &=   boxed{5 + 45i}.
  end{align*}

Writing out the equations of the circles, we have that:    begin{align*}
(x-2)^2+(y+1)^2 &= 16     
(x-2)^2+(y-5)^2 &= 10
  end{align*}To solve for the common  y  value of both  A  and  B , we can subtract the two equations to find that  (y+1)^2 - (y-5)^2 = 6 . Simplifying gives that  (y+1)^2 - (y-5)^2 = 2y + 1 + 10y - 25 = 12y - 24 = 6,  so that  y =   frac{30}{12} =   frac {5}2 . Substituting back into either of the above circle equations yields that  (x-2)^2 =   frac{15}{4} . Thus,  x - 2 =   pm   frac{  sqrt{15}}{2} , so  x = 2   pm   frac{  sqrt{15}}{2} . The distance between  A  and  B  is simply the difference of their x-coordinates, or     left(2 +   frac{  sqrt{15}}{2}  right) -   left(2 -   frac{  sqrt{15}}{2}  right) =   sqrt{15}.  Thus  (AB)^2=(  sqrt{15})^2=  boxed{15} .

