Problem:
Let   [f(x) =
  begin{cases}
3x + 5 &  text{if }x<-3,     
7-4x&  text{if }x  ge -3.
  end{cases}
  ]Find  f(5) .

Solution:
First, we try to simplify like terms. We find the prime factorizations of  45  and  360 :  45 = 3^2   cdot 5  and  360 = 2^3   cdot 3^2   cdot 5 . Hence,     sqrt{45} =   sqrt{3^2   cdot 5} = 3  sqrt{5}  and   begin{align*}
  sqrt{360} &=   sqrt{2^3   cdot 3^2   cdot 5}    
&=   sqrt{(2   cdot 3)^2}   cdot   sqrt{2   cdot 5} = 6   sqrt{2   cdot 5}.
  end{align*}Returning to the given expression,    begin{align*}
3  sqrt{5} - 2  sqrt{5} +   frac{6   sqrt{2}   cdot   sqrt{5}}{  sqrt{2}} &= 3  sqrt{5} - 2  sqrt{5} + 6  sqrt{5}    
&= 7  sqrt{5} =   sqrt{7^2   cdot 5} =   sqrt{245}.
  end{align*}Thus,  N =   boxed{245} .

Setting    frac{4b+19}{6b+11}  equal to  0.76=  frac{76}{100}=  frac{19}{25} , we have   begin{align*}   frac{4b+19}{6b+11}&=  frac{19}{25}
      Rightarrow  qquad 25(4b+19)&=19(6b+11)
      Rightarrow  qquad 100b+475&=114b+209
      Rightarrow  qquad -14b&=-266
      Rightarrow  qquad b&=  boxed{19}
  end{align*}.

By the quadratic formula, the roots of the equation are    begin{align*}
  frac{-b  pm  sqrt{b^2-4ac}}{2a}&=  frac{-k  pm  sqrt{k^2-4(5)(1)}}{2(1)}    
&=  frac{-k  pm  sqrt{k^2-20}}{2}.
  end{align*} We want the difference of the roots, so we take the larger minus the smaller:    begin{align*}
  left(  frac{-k+  sqrt{k^2-20}}{2}  right)-  left(  frac{-k-  sqrt{k^2-20}}{2}  right)&=  frac{2  sqrt{k^2-20}}{2}    
&=  sqrt{k^2-20}.
  end{align*} We are given that this difference is equal to    sqrt{61} , so we have   begin{align*}
  sqrt{k^2-20}&=  sqrt{61}  quad  Rightarrow    
k^2-20&=61  quad  Rightarrow    
k^2&=81  quad  Rightarrow    
k&=  pm 9.
  end{align*} Thus the greatest possible value of  k  is    boxed{9} .

We can multiply the second equation by 5, so that our equations are   begin{align*}
5j -42k &=1  text{, and}     
-5j +10k &=15.   end{align*}Summing these equations gives  -32k=16 , so  k=-16/32=-1/2 . We substitute this value for  k  into one of the equations to solve for  j :   begin{align*}
2  left(  frac{-1}{2}  right)-j&=3   quad   Rightarrow      j &= -4.
  end{align*}So the solution is    boxed{(-4,-  frac{1}{2})} .

Problem:
Let  f  be defined by    [f(x) =   left  {
  begin{array}{cl}
2-x &   text{ if } x   leq 1,     
2x-x^2 &   text{ if } x>1.
  end{array}
  right.  ]Calculate  f^{-1}(-3)+f^{-1}(0)+f^{-1}(3) .

Solution:
The number  f^{-1}(-3)  is the value of  x  such that  f(x) = -3 .  Since the function  f  is defined piecewise, to find this value, we must consider both cases  x   le 1  and  x > 1 .

If  x   le 1  and  f(x) = -3 , then  2 - x = -3 , which leads to  x = 5 .  But this value does not satisfy the condition  x   le 1 .  If  x > 1  and  f(x) = -3 , then  2x - x^2 = -3 , or  x^2 - 2x - 3 = 0 .  This equation factors as  (x - 3)(x + 1) = 0 , so  x = 3  or  x = -1 .  The only value that satisfies the condition  x > 1  is  x = 3 , so  f^{-1}(-3) = 3 .

Next, we compute  f^{-1}(0) , which is the value of  x  such that  f(x) = 0 .

If  x   le 1  and  f(x) = 0 , then  2 - x = 0 , which leads to  x = 2 .  But this value does not satisfy the condition  x   le 1 .  If  x > 1  and  f(x) = 0 , then  2x - x^2 = 0 , or  x^2 - 2x = 0 .  This equation factors as  x(x - 2) = 0 , so  x = 0  or  x = 2 .  The only value that satisfies  x > 1  is  x = 2 , so  f^{-1}(0) = 2 .

Finally, we compute  f^{-1}(3) , which is the value of  x  such that  f(x) = 3 .

If  x   le 1  and  f(x) = 3 , then  2 - x = 3 , which leads to  x = -1 .  Note that this value satisfies the condition  x   le 1 .  If  x > 1  and  f(x) = 3 , then  2x - x^2 = 3 , or  x^2 - 2x + 3 = 0 .  This equation can be written as  (x - 1)^2 + 2 = 0 , which clearly has no solutions, so  f^{-1}(3) = -1 .

Therefore,  f^{-1}(-3) + f^{-1}(0) + f^{-1}(3) = 3 + 2 + (-1) =   boxed{4} .

