Problem:
Allie and Betty play a game where they take turns rolling a standard die. If a player rolls  n , she is awarded  f(n)  points, where    [f(n) =   left  {
  begin{array}{cl} 6 &   text{ if }n  text{ is a multiple of 2 and 3},     
2 &   text{ if }n  text{ is only a multiple of 2},     
0 &   text{ if }n  text{ is not a multiple of 2}.
  end{array}
  right.  ]Allie rolls the die four times and gets a 5, 4, 1, and 2. Betty rolls and gets 6, 3, 3, and 2. What is the product of Allie's total points and Betty's total points?

Solution:
Writing everything in terms of prime factorizations, the given expression is    begin{align*}
  sqrt{2   cdot 5   cdot 5   cdot 2   cdot 3   cdot p^7} &=   sqrt{(2^2   cdot 5^2   cdot p^6)   cdot (3   cdot p)}     
&=   boxed{10p^3   sqrt{3p}}.
  end{align*}

Let's start by rewriting this problem into equation form:

  begin{align*}
x + y &= 50,     
x - y &= 6.
  end{align*}

We want to find  xy , so let's find  x  and  y  separately.

Begin by adding the two equations:    begin{align*}
2x &= 56     
x &= 28
  end{align*} Now, subtract the two equations   begin{align*}
2y &= 44     
y &= 22
  end{align*}

So then  x   cdot y = 22   cdot 28 =   boxed{616}

Problem:
Rationalize the denominator of    displaystyle   frac{1}{  sqrt{2} +   sqrt{3} +   sqrt{7}} , and write your answer in the form   [
  frac{A  sqrt{2} + B  sqrt{3} + C  sqrt{7} + D  sqrt{E}}{F},
  ]where everything is in simplest radical form and the fraction is in lowest terms, and  F  is positive. What is  A + B + C + D + E + F ?

Solution:
Since 2, 3, and 7 are all primes, the denominator is in simplest radical form and we can't simplify it further. We attack this problem by getting rid of the square roots one step at a time. First we group the first two terms, and multiply numerator and denominator by the conjugate:   begin{align*}
  frac{1}{(  sqrt{2} +   sqrt{3}) +   sqrt{7}} & =   frac{1}{(  sqrt{2} +   sqrt{3}) +   sqrt{7}}   cdot   frac{(  sqrt{2} +   sqrt{3}) -   sqrt{7}}{(  sqrt{2} +   sqrt{3}) -   sqrt{7}}     
& =   frac{(  sqrt{2} +   sqrt{3}) -   sqrt{7}}{(  sqrt{2} +   sqrt{3})^2 - (  sqrt{7})^2}     
& =   frac{(  sqrt{2} +   sqrt{3}) -   sqrt{7}}{2 + 2  sqrt{6} + 3 - 7}     
& =   frac{  sqrt{2} +   sqrt{3} -   sqrt{7}}{-2 + 2  sqrt{6}}
  end{align*}Now this is in a form we know how to deal with, and we can just multiply by the conjugate as usual:   begin{align*}
  frac{  sqrt{2} +   sqrt{3} -   sqrt{7}}{-2 + 2  sqrt{6}} & =   frac{  sqrt{2} +   sqrt{3} -   sqrt{7}}{-2 + 2  sqrt{6}}   cdot   frac{-2 - 2  sqrt{6}}{-2 - 2  sqrt{6}}     
& =   frac{-2  sqrt{2} - 2  sqrt{3} + 2  sqrt{7} - 2  sqrt{12} - 2  sqrt{18} + 2  sqrt{42}}{-20}     
& =   frac{4  sqrt{2} + 3  sqrt{3} -   sqrt{7} -   sqrt{42}}{10}.
  end{align*}This gives  A + B + C + D + E + F = 4 + 3 - 1 - 1 + 42 + 10 =   boxed{57} .

Problem:
Let   [f(x) =   left  {
  begin{array}{cl}
  frac{x}{21} &   text{ if }x  text{ is a multiple of 3 and 7},     
3x &   text{ if }x  text{ is only a multiple of 7},     
7x &   text{ if }x  text{ is only a multiple of 3},     
x+3 &   text{ if }x  text{ is not a multiple of 3 or 7}.
  end{array}
  right.  ]If  f^a(x)  means the function is nested  a  times (for example,  f^2(x)=f(f(x)) ), what is the smallest value of  a  greater than 1 that satisfies  f(2)=f^a(2) ?

Solution:
Since 2 is not a multiple of 3 or 7,  f(2)=2+3=5  and we want to find an  a  where  f^a(2)=5 . So, we keep track of how many times we evaluate  f  of our previous result until we get 5.    begin{align*}
f(2)&=5    
f(f(2))&=f(5)=5+3=8   qquad 5   text{ is not a multiple of 3 or 7.}    
f(f(f(2)))&=f(8)=8+3=11   qquad 8   text{ is not a multiple of 3 or 7.}    
