Problem:
Let   [f(x) =
  begin{cases}
x/2 &  quad   text{if } x   text{ is even},     
3x+1 &  quad   text{if } x   text{ is odd}.
  end{cases}
  ]What is  f(f(f(f(1)))) ?

Solution:
First, notice that all three integers have a common factor of 10.  We can remove this factor from the cube root as shown:   begin{align*}
  sqrt[3]{10^3  cdot3^3+10^3  cdot4^3+10^3  cdot5^3}&=  sqrt[3]{10^3(3^3+4^3+5^3)}    
&=10  sqrt[3]{3^3+4^3+5^3}.
  end{align*} Now, evaluate the expression under the cube root:   10  sqrt[3]{3^3+4^3+5^3}=10  sqrt[3]{27+64+125}=10  sqrt[3]{216}.   Since  216=6^3 , this expression simplifies to:   10  sqrt[3]{6^3}=  boxed{60}.

Let Amy's, Ben's, and Chris's ages be  a ,  b , and  c , respectively. We have the equations   begin{align*}   tag{1}
  frac{a+b+c}{3}=9   Rightarrow a+b+c&=27        tag{2}
c-4&=a       tag{3}
b+3&=  frac{2}{3}(a+3)
  end{align*} From Equation (3), we have  b=  frac{2}{3}(a+3)-3 . We substitute Equation (2) into Equation (3) to eliminate  a , to get  b=  frac{2}{3}(c-1)-3 . Substituting this last equation and Equation (2) into Equation (1) to eliminate  a  and  b , we have    [[c-4]+[  frac{2}{3}(c-1)-3]+c=27  ] Solving for  c , we find that  c=13 . Thus, Chris's age is    boxed{13} .

