6+5x+x^2&=5+6x+x^2    
x&=  boxed{1}.
  end{align*}

Problem:
Each letter represents a non-zero digit. What is the value of  t?    begin{align*}
c + o &= u     
u + n &= t     
t + c &= s     
o + n + s &= 12
  end{align*}

Solution:
Since the difference of the first two terms is  -2y , the third and fourth terms of the sequence must be  x-3y  and  x-5y . Thus   [
x-3y = xy   quad  text{and}  quad x-5y =   frac{x}{y},
  ]so  xy - 5y^{2} = x.  Combining these equations we obtain   [
(x - 3y) - 5y^{2}= x  quad  text{and, therefore, }  quad -3y - 5y^{2} = 0.
  ]Since  y  cannot be 0, we have  y = -  frac{3}{5} , and it follows that  x = -  frac{9}{8} . The fifth term in the sequence is  x - 7y
=   boxed{  frac{123}{40}} .

We begin by adding 2 to both sides of the equation,   begin{align*} 23&=x^4+  frac{1}{x^4}
      Rightarrow  qquad 25&=x^4+  frac{1}{x^4}+2
      Rightarrow  qquad 25&=x^4+2(x^2)  left(  frac{1}{x^2}  right)+  frac{1}{x^4}
      Rightarrow  qquad 25&=  left(x^2+  frac{1}{x^2}  right)^2
  end{align*}  So  x^2+  frac{1}{x^2}  is equal to either  5  or  -5 . Since  x^2+  frac{1}{x^2}  is the sum of two squares, it cannot be negative.  So  x^2+  frac{1}{x^2}=  boxed{5} .

For Manu to win on his first turn, the sequence of flips would have to be TTH, which has probability    left(  frac{1}{2}  right)^3 .  For Manu to win on his second turn, the sequence of flips would have to be TTTTTH, which has probability    left(  frac{1}{2}  right)^6 .  Continuing, we find that the probability that Manu wins on his  n th turn is    left(  frac{1}{2}  right)^{3n} .  The probability that Manu wins is the sum of these probabilities, which is   [
  frac{1}{2^3}+  frac{1}{2^6}+  frac{1}{2^9}+  cdots=  frac{  frac{1}{2^3}}{1-  frac{1}{2^3}}=  boxed{  frac{1}{7}},
  ] where we have used the formula  a/(1-r)  for the sum of an infinite geometric series whose first term is  a  and whose common ratio is  r .

