Solution:
Because the point for which we are looking is on the  x -axis, we know that it is of the form  (x, 0) . We apply the distance formula. The distance from A is    begin{align*}
  sqrt{(-2-x)^2+(0-0)^2} &=   sqrt{x^2+4x+4}
  end{align*} The distance from B is    begin{align*}
  sqrt{(0-x)^2 + (4-0)^2} &=   sqrt{x^2+16}
  end{align*} Because the point is equidistant from A and B, we set the two distances equal:  x^2+4x+4 = x^2 + 16 . Simplifying gives us  4x = 12 , or  x =   boxed{3} .

We can factor the expression  x+2  out of each term:    begin{align*}
x(x+2)+(x+2) &= x   cdot (x+2)+1   cdot (x+2)    
&=   boxed{(x+1)(x+2)}
  end{align*}

Let  a  be Andrew's age now and  g  be his grandfather's age now. We are looking for the value of  a . We can set up a system of two equations to represent the given information, as follows:

  begin{align*}
g &= 12a     
g-a &= 55     
  end{align*}

In particular, the second equation represents the grandfather's age  a  years ago, when Andrew was born. To solve for  a , we need to eliminate  g  from the equations above. Substituting the first equation into the second to eliminate  g , we get that  12a-a=55  or  a=5 . Thus, Andrew is    boxed{5}  years old now.

Noticing that both 64 and 32 are powers of 2, we can rewrite the expression as    left(2^6  right)^5=  left( 2^5   right) ^x . Simplifying, we get   begin{align*}
  left(2^6  right)^5&=  left( 2^5   right) ^x     
2^{6   cdot 5} &= 2^{5   cdot x}     
2^{30} &= 2^{5x}     
2^6&=2^x     
2^{-6} &= 2^{-x}
  end{align*} Thus,  2^{-6}=  frac{1}{2^6}=  boxed{  frac{1}{64}} .

Since a square root is an exponent of    frac{1}{2}  and since exponents distribute across multiplication, we can combine the radicals.   [
  sqrt{8}  cdot   sqrt{50}=  sqrt{8  cdot50}.
  ] Now split the radicand into prime factors:  8  cdot50=2  cdot2  cdot2  cdot2  cdot5^2=(2  cdot2)^2  cdot5^2 .  We find    sqrt{8  cdot50}=  sqrt{(2  cdot2)^2  cdot5^2}=2  cdot2  cdot5=  boxed{20} .

We make  a+  sqrt{d}=  sqrt{53+20  sqrt{7}} . Squaring both sides, we get:   begin{align*}
