  Rightarrow   frac{1}{x}+  frac{1}{2}&=.75    
  Rightarrow   frac{1}{x}&=.25    
  Rightarrow x&=  boxed{4}.
  end{align*}

Problem:
The fifth term of a geometric sequence of positive numbers is  11  and the eleventh term is  5 . What is the eighth term of the sequence? Express your answer in simplest radical form.  [asy]
size(150); defaultpen(linewidth(2));
real loc = 0;
for(int i = 0; i < 11; ++i) {

if(i == 4)

label("   mathbf{  mathit{11}} ",(loc,0),(0.8,1.2),fontsize(14));

if(i == 10)

label("   mathbf{  mathit{5}} ",(loc,0),(1.2,1.2),fontsize(14));

fill(box((loc,0),(loc+1,0.15)));

loc += 4/3;
}
[/asy]

Solution:
The  point  (a,b)  is the foot of the perpendicular from  (12,10)  to the line  y=-5x+18 .  The perpendicular has slope    frac{1}{5} , so its equation is   [
y=10+  frac{1}{5}(x-12)=  frac{1}{5}x+  frac{38}{5}.
  ]The  x -coordinate at the foot of the perpendicular satisfies the equation   [
  frac{1}{5}x+  frac{38}{5}=-5x+18,
  ]so  x=2  and  y=-5  cdot2+18=8 . Thus  (a,b) = (2,8) , and  a+b =   boxed{10} .

